import { SingleTodo } from "./components/SingleTodo";
import { Todos } from "./components/Todos";
import "./index.css";

function App() {
  return (
    <div
      style={{ backgroundImage: "url(./bg.jpg)" }}
      className="h-screen flex flex-col items-center pt-20 "
    >
      <h1 className="text-white mb-10 text-4xl">
        Todo Application with React/Redux
      </h1>
      <Todos />
      <SingleTodo />
    </div>
  );
}

export default App;
